    "2016-07-27T22:41:43.873931",nt"name": "assessment-of-trace-metal-exposures-to-aquatic-biota-from-historical-mine-sites-in-the-wes",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of this investigation is to
    identify and characterize the nature and extent of sediment and food chain contamination,
    and to determine the potential for adverse effects to aquatic life, from metals
    in drainage emanating from current and historical mine sites. To achieve this purpose,
    this investigation accomplished the following tasks: 1) determination of metals
    and trace elements in water, sediment, aquatic benthic invertebrates, and fish tissues;
    2) aquatic invertebrate community assessment; 3) fish community assessment; and
    4) fish health assessment. This investigation indicates significant impacts may
    be occurring to aquatic biota in streams that are identified as potential LCT recovery
    areas (Service 1995); or to waterfowl and piscivorous birds in select drainages.",nt"license_title":
